"use strict";
const iconNavbarSidenav = document.getElementById("iconNavbarSidenav")
    , iconSidenav = document.getElementById("iconSidenav")
    , sidenav = document.getElementById("sidenav-main");
let body = document.getElementsByTagName("body")[0]
    , className = "g-sidenav-pinned";
function toggleSidenav() {
    body.classList.contains(className) ? (body.classList.remove(className),
        setTimeout(function () {
            sidenav.classList.remove("bg-white")
        }, 100),
        sidenav.classList.remove("bg-transparent")) : (body.classList.add(className),
            sidenav.classList.remove("bg-transparent"),
            iconSidenav.classList.remove("d-none"))
}
iconNavbarSidenav && iconNavbarSidenav.addEventListener("click", toggleSidenav),
    iconSidenav && iconSidenav.addEventListener("click", toggleSidenav);
let referenceButtons = document.querySelector("[data-class]");
function navbarColorOnResize() {
    sidenav && (1200 < window.innerWidth ? referenceButtons.classList.contains("active") && "bg-transparent" === referenceButtons.getAttribute("data-class") ? sidenav.classList.remove("bg-white") : document.querySelector("body").classList.contains("dark-version") || sidenav.classList.add("bg-white") : sidenav.classList.remove("bg-transparent"))
}


function sidenavTypeOnResize() {
    var e = document.querySelectorAll('[onclick="sidebarType(this)"]');
    window.innerWidth < 1200 ? e.forEach(function (e) {
        e.classList.add("disabled")
    }) : e.forEach(function (e) {
        e.classList.remove("disabled")
    })
}

function darkMode(e) {
    var t = document.getElementsByTagName("body")[0]
        , a = document.querySelectorAll("div:not(.sidenav) > hr")
        , n = document.querySelectorAll("div:not(.bg-gradient-dark) hr")
        , i = document.querySelectorAll("button:not(.btn) > .text-dark")
        , l = document.querySelectorAll("span.text-dark, .breadcrumb .text-dark")
        , s = document.querySelectorAll("span.text-white, .breadcrumb .text-white")
        , r = document.querySelectorAll("strong.text-dark")
        , o = document.querySelectorAll("strong.text-white")
        , c = document.querySelectorAll("a.nav-link.text-dark")
        , d = document.querySelectorAll("a.nav-link.text-white")
        , u = document.querySelectorAll(".text-secondary")
        , m = document.querySelectorAll(".bg-gray-100")
        , g = document.querySelectorAll(".bg-gray-600")
        , f = document.querySelectorAll(".btn.btn-link.text-dark, .material-icons.text-dark")
        , h = document.querySelectorAll(".btn.btn-link.text-white, .material-icons.text-white")
        , v = document.querySelectorAll(".card.border")
        , p = document.querySelectorAll(".card.border.border-dark")
        , y = document.querySelectorAll(".main-content .container-fluid .card")
        , b = document.querySelectorAll("g");
    if (e.getAttribute("checked")) {
        t.classList.remove("dark-version");
        for (w = 0; w < a.length; w++)
            a[w].classList.contains("light") && (a[w].classList.add("dark"),
                a[w].classList.remove("light"));
        for (w = 0; w < n.length; w++)
            n[w].classList.contains("light") && (n[w].classList.add("dark"),
                n[w].classList.remove("light"));
        for (w = 0; w < y.length; w++)
            y[w].classList.add("blur", "shadow-blur");
        for (w = 0; w < i.length; w++)
            i[w].classList.contains("text-white") && (i[w].classList.remove("text-white"),
                i[w].classList.add("text-dark"));
        for (w = 0; w < s.length; w++)
            !s[w].classList.contains("text-white") || s[w].closest(".sidenav") || s[w].closest(".card.bg-gradient-dark") || (s[w].classList.remove("text-white"),
                s[w].classList.add("text-dark"));
        for (w = 0; w < o.length; w++)
            o[w].classList.contains("text-white") && (o[w].classList.remove("text-white"),
                o[w].classList.add("text-dark"));
        for (w = 0; w < d.length; w++)
            d[w].classList.contains("text-white") && !d[w].closest(".sidenav") && (d[w].classList.remove("text-white"),
                d[w].classList.add("text-dark"));
        for (w = 0; w < u.length; w++)
            u[w].classList.contains("text-white") && (u[w].classList.remove("text-white"),
                u[w].classList.remove("opacity-8"),
                u[w].classList.add("text-dark"));
        for (w = 0; w < g.length; w++)
            g[w].classList.contains("bg-gray-600") && (g[w].classList.remove("bg-gray-600"),
                g[w].classList.add("bg-gray-100"));
        for (w = 0; w < b.length; w++)
            b[w].hasAttribute("fill") && b[w].setAttribute("fill", "#252f40");
        for (w = 0; w < h.length; w++)
            h[w].closest(".card.bg-gradient-dark") || (h[w].classList.remove("text-white"),
                h[w].classList.add("text-dark"));
        for (w = 0; w < p.length; w++)
            p[w].classList.remove("border-dark");
        e.removeAttribute("checked")
    } else {
        t.classList.add("dark-version");
        for (var w = 0; w < a.length; w++)
            a[w].classList.contains("dark") && (a[w].classList.remove("dark"),
                a[w].classList.add("light"));
        for (var w = 0; w < y.length; w++)
            y[w].classList.contains("blur") && y[w].classList.remove("blur", "shadow-blur");
        for (var w = 0; w < n.length; w++)
            n[w].classList.contains("dark") && (n[w].classList.remove("dark"),
                n[w].classList.add("light"));
        for (var w = 0; w < i.length; w++)
            i[w].classList.contains("text-dark") && (i[w].classList.remove("text-dark"),
                i[w].classList.add("text-white"));
        for (var w = 0; w < l.length; w++)
            l[w].classList.contains("text-dark") && (l[w].classList.remove("text-dark"),
                l[w].classList.add("text-white"));
        for (var w = 0; w < r.length; w++)
            r[w].classList.contains("text-dark") && (r[w].classList.remove("text-dark"),
                r[w].classList.add("text-white"));
        for (var w = 0; w < c.length; w++)
            c[w].classList.contains("text-dark") && (c[w].classList.remove("text-dark"),
                c[w].classList.add("text-white"));
        for (var w = 0; w < u.length; w++)
            u[w].classList.contains("text-secondary") && (u[w].classList.remove("text-secondary"),
                u[w].classList.add("text-white"),
                u[w].classList.add("opacity-8"));
        for (var w = 0; w < m.length; w++)
            m[w].classList.contains("bg-gray-100") && (m[w].classList.remove("bg-gray-100"),
                m[w].classList.add("bg-gray-600"));
        for (var w = 0; w < f.length; w++)
            f[w].classList.remove("text-dark"),
                f[w].classList.add("text-white");
        for (var w = 0; w < b.length; w++)
            b[w].hasAttribute("fill") && b[w].setAttribute("fill", "#fff");
        for (var w = 0; w < v.length; w++)
            v[w].classList.add("border-dark");
        e.setAttribute("checked", "true")
    }
}

window.addEventListener("resize", navbarColorOnResize),
    window.addEventListener("resize", sidenavTypeOnResize),
    window.addEventListener("load", sidenavTypeOnResize),
    window.onload = function () {
        for (var e = document.querySelectorAll("input"), t = 0; t < e.length; t++)
            e[t].hasAttribute("value") && e[t].parentElement.classList.add("is-filled"),
                e[t].addEventListener("focus", function (e) {
                    this.parentElement.classList.add("is-focused")
                }, !1),
                e[t].onkeyup = function (e) {
                    "" != this.value ? this.parentElement.classList.add("is-filled") : this.parentElement.classList.remove("is-filled")
                }
                ,
                e[t].addEventListener("focusout", function (e) {
                    "" != this.value && this.parentElement.classList.add("is-filled"),
                        this.parentElement.classList.remove("is-focused")
                }, !1);
        for (var a = document.querySelectorAll(".btn"), t = 0; t < a.length; t++)
            a[t].addEventListener("click", function (e) {
                var t = e.target
                    , a = t.querySelector(".ripple");
                (a = document.createElement("span")).classList.add("ripple"),
                    a.style.width = a.style.height = Math.max(t.offsetWidth, t.offsetHeight) + "px",
                    t.appendChild(a),
                    a.style.left = e.offsetX - a.offsetWidth / 2 + "px",
                    a.style.top = e.offsetY - a.offsetHeight / 2 + "px",
                    a.classList.add("ripple")
            }, !1)
    }



function navbarMinimize(e) {
    var navbarMinimize = document.querySelectorAll('.nMinimize');

    var x = e.getAttribute("checked");


    var g_body = document.getElementById("g_body");

    // onn tagler
    if (x) {
        navbarMinimize.forEach(el => el.removeAttribute("checked", "true"));
        g_body.classList.add("g-sidenav-pinned");
        g_body.classList.remove("g-sidenav-hidden");
    }
    // off tagler
    else {
        navbarMinimize.forEach(el => el.setAttribute("checked", "true"));
        g_body.classList.remove("g-sidenav-pinned");
        g_body.classList.add("g-sidenav-hidden");
    }
}

//  d-none tangtangon ug small size na ang screen css ni by class

function client_prof(){
    var classNm = "ps show";
    document.getElementById('to_repeat').classList.add(...classNm.split(" "))
}

function client_prof_close(){
    var classNm = "ps show";
    document.getElementById('to_repeat').classList.remove(...classNm.split(" "))
}

function fixbar(e){
    var l_top = document.getElementById('layer_top');
    if (e.getAttribute("checked")) {
        l_top.classList.remove('top-0');
        e.removeAttribute("checked")
    }else{
        l_top.classList.add('top-0');
        e.setAttribute("checked", "true")
    }
}




